uid: microsoft.quantum.math.iscoprimei
name: IsCoprimeI
type: function
namespace: microsoft.quantum.math
summary: $A $ 및 $b $가 같은 경우 true를 반환 하 고 그렇지 않으면 false를 반환 합니다.
syntax: 'function IsCoprimeI (a : Int, b : Int) : Bool'
input:
  content: '(a : Int, b : Int)'
  types:
  - name: a
    summary: 공동 primality을 테스트 하는 첫 번째 숫자입니다.
    isPrimitive: true
    uid: Int
  - name: b
    summary: 공동 primality을 테스트 하는 두 번째 숫자입니다.
    isPrimitive: true
    uid: Int
output:
  content: Bool
  types:
  - summary: '$A $ 및 $b $가 같은 경우 (예: 최대 공약수가 1 임) True이 고, 그렇지 않으면 false입니다.'
    isPrimitive: true
    uid: Bool
